                end
            end)

            local secondsLeft = parseTimer(timerText or "") or 0
            if secondsLeft <= 0 then continue end

            -- Use UTC timestamp for expire
            local expireTimestamp = getUTCTime() + secondsLeft
            currentServerRifts[riftId] = expireTimestamp

